import React from 'react'
import Hero from '../components/Hero';
import Banner from '../components/Banner'
import {Link} from ''

export default function Home() {
    return (
        <Hero>
        <Banner title = "luxurios rooms" subtitle = "delux rooms starting at $299">
        <Link></Link>
        </Banner>
        </Hero>
    )
}
